import React from "react";

type ListItemProps = {
    text: string;
    onClick: () => void;
};

const ListItem: React.FC<ListItemProps> = ({ text, onClick }) => {
    return (
        <li
            onClick={onClick}
            className="cursor-pointer p-2 bg-[#f5f5f5] rounded hover:bg-gray-200 list-none"
        >
            {text}
        </li>
    );
};

export default ListItem;
